import React from "react";
import { useSearchParams } from "react-router-dom";
import { useState } from "react";
function Filter(){
    const [SearchParams, setSearchParmas] = useSearchParams();
    const [inputVal, setInputVal] = useState();
    let age = SearchParams.get("age");
    let city = SearchParams.get("city");
    console.log(city);
    console.log(age);
return(
    <>
    <h1>SearchParams</h1>
    <h3>Age: {age}</h3>
    <h3>City: {city}</h3>
    <br/>
    {/* <input type="text" onChange={(e)=> setSearchParmas({text:e.target.value,age:19,city:"ghotki"})} placeholder="Set Search params"/> */}
   <input type="text" onChange={(e)=> setSearchParmas({text:e.target.value,age:19,city:"ghotki"}, setInputVal(e.target.value))} placeholder="Set Search params"/>
   <br/>
   <h1>Input Value : {inputVal}</h1>
   <br/>
   <button onClick={()=> setSearchParmas({age:19,city:"ghotki"})}>Click me</button>
    </>
)
}

export default Filter;
